  \ i is c_i. Here, the color of each vertex is represented by an integer between\
  \ 1 and N (inclusive). The same integer corresponds to the same color; different\
  \ integers correspond to different colors.\n\nFor each k=1, 2, ..., N, solve the\
  \ following problem:\n\n* Find the number of simple paths that visit a vertex painted\
  \ in the color k one or more times.\n\n\n\nNote: The simple paths from Vertex u\
  \ to v and from v to u are not distinguished.\n\nConstraints\n\n* 1 \\leq N \\leq\
  \ 2 \\times 10^5\n* 1 \\leq c_i \\leq N\n* 1 \\leq a_i,b_i \\leq N\n* The given\
  \ graph is a tree.\n* All values in input are integers.\n\nInput\n\nInput is given\
  \ from Standard Input in the following format:\n\n\nN\nc_1 c_2 ... c_N\na_1 b_1\n\
  :\na_{N-1} b_{N-1}\n\n\nOutput\n\nPrint the answers for k = 1, 2, ..., N in order,\
  \ each in its own line.\n\nExamples\n\nInput\n\n3\n1 2 1\n1 2\n2 3\n\n\nOutput\n\
  \n5\n4\n0\n\n\nInput\n\n1\n1\n\n\nOutput\n\n1\n\n\nInput\n\n2\n1 2\n1 2\n\n\nOutput\n\
  \n2\n2\n\n\nInput\n\n5\n1 2 3 4 5\n1 2\n2 3\n3 4\n3 5\n\n\nOutput\n\n5\n8\n10\n\
  5\n5\n\n\nInput\n\n8\n2 7 2 5 4 1 7 5\n3 1\n1 2\n2 7\n4 5\n5 6\n6 8\n7 8\n\n\nOutput\n\
  \n18\n15\n0\n14\n23\n0\n23\n0\nA: ```import sys\nread = sys.stdin.buffer.read\n\
  readline = sys.stdin.buffer.readline\nreadlines = sys.stdin.buffer.readlines\n\n\
  \ndef EulerTour(graph, root=1):\n    N = len(graph) - 1\n    parent = [0] * (N +\
  \ 1)\n    stack = [-root, root]\n    tour = []\n    ind_L = [0] * (N + 1)\n    ind_R\
  \ = [0] * (N + 1)\n    i = -1\n    while stack:\n        v = stack.pop()\n     \
  \   tour.append(v)\n        i += 1\n        if v > 0:\n            ind_L[v] = i\n\
  \            p = parent[v]\n            for w in graph[v]:\n                if w\
  \ == p:\n                    continue\n                parent[w] = v\n         \
  \       stack.append(-w)\n                stack.append(w)\n        else:\n     \
  \       ind_R[-v] = i\n    return tour, ind_L, ind_R, parent\n\n\nN = int(readline())\n\
  graph = [[] for _ in range(N + 1)]\nC = (0,) + tuple(map(int, readline().split()))\n\
  m = map(int, read().split())\nfor a, b in zip(m, m):\n    graph[a].append(b)\n \
  \   graph[b].append(a)\n\ntour, ind_L, ind_R, parent = EulerTour(graph)\nremoved\
  \ = [0] * (N + 1)\nanswer = [N * (N + 1) // 2] * (N + 1)\nmemo = [0] * (N + 1)\n\
  \nfor v in tour:\n    if v > 0:\n        memo[v] = removed[C[parent[v]]]\n    else:\n\
  \        v = -v\n        removed[C[v]] += 1\n        p = parent[v]\n        x =\
  \ (ind_R[v] - ind_L[v]) // 2 + 1  # subtree size\n        x -= removed[C[p]] - memo[v]\n\
  \        answer[C[p]] -= x * (x + 1) // 2\n        removed[C[p]] += x\n\nfor i,\
  \ x in enumerate(removed):\n    x = N - x\n    answer[i] -= x * (x + 1) // 2\nprint('\\\
  n'.join(map(str, answer[1:])))```\nQ: Write python code to solve the following coding\
